def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data._get_numeric_data()

    agg_blocks: List[Block] = []
    agg_items: List[Block] = []

    for block in data.blocks:
        try:
            result, _ = self.aggregate(block.values, how, axis=1, min_count=min_count)
            agg_block: Block = block.make_block(result)
            agg_blocks.append(agg_block)
            agg_items.append(block.mgr_locs)
        except Exception as e:
            # Handle the exception or unsupported operations
            pass

    if not (agg_blocks or split_frames):
        raise DataError("No numeric types to aggregate")

    # Reset the locs in the blocks to correspond to the current ordering
    # Perform necessary cleanup and adjustment of indices if needed

    return agg_blocks, agg_items
